import axios from "axios";
export const getCart = async (encodedToken) => {
  try {
    const {status,data} = await axios.get("/api/user/cart", {
      headers: { authorization: encodedToken },
    });
    if(status===200){
      return data?.cart;
    }
  } catch (e) {
    console.log(e);
  }
};
